import React from 'react';
import { Link } from 'react-router-dom';
import { Menu } from 'semantic-ui-react';


const Header = () => {
	return (
		<div class="ui secondary pointing menu">
			<a class="item active">
				Home
			</a>
			<a class="item">
				Messages
			</a>
			<a class="item">
				Friends
			</a>
			<div class="right menu">
				<a class="ui item">
				Logout
				</a>
			</div>
			</div>



	)
}

export default Header;
